import './App.css';
import profile from "./images/me.png";
function App() {
  const action=["design","accept challenges", "develop"]
  return (
    <div className="App">
      <div className="intro">
        <div className="typewriter">
          <h1>Front End Developer and Mentor</h1>
          <p>Person who loves to {action}  </p>
        </div>
        <div>
          <img src={profile}  alt="" /> 
        </div>
      </div>  
    </div>
  );
}

export default App;
